import React from 'react';
import {setPage} from '../../features/productsSlice';
import { useDispatch, useSelector } from 'react-redux';
import { moveAheadButton } from './paginationActions';


const PaginationElement = ({page, pagin, range}) => {
    const dispatch = useDispatch() 
    const store = useSelector(state => state.productsSlice)
    const handleClick= () => {
        if(parseInt(page)) {
            dispatch(setPage({page: page}))
            moveAheadButton()
        }
    }
    return (
        <div className={page === store.page ? "currentPage": "numberOfPageButton"}
            onClick={handleClick}
        > 
            {page}
        </div>
    )
}

export default PaginationElement
